import React from "react";

const Hero = () => {
    return (
      <section id="hero" className="min-h-screen flex flex-col justify-center items-center bg-gray-900 text-white">
        <h1 className="text-6xl font-bold" data-aos="fade-down">
          Rohann Keerthy
        </h1>
        <p className="mt-4 text-xl" data-aos="fade-up" data-aos-delay="200">
        Driven Computer Science and Engineering student specializing in Artificial Intelligence and Machine Learning, dedicated to designing innovative, scalable solutions that enhance user experiences and optimize system performance.
        </p>
        <p className="mt-2 text-lg" data-aos="fade-up" data-aos-delay="400">
        Rohann Keerthy is a passionate and proactive Bachelor of Engineering student at Mahatma Gandhi Institute of Technology, pursuing a degree in Computer Science and Engineering with a focus on AI and ML (CGPA: 7.86). With hands-on experience as a Backend Developer Intern at Ezynest LLC, he excels in building RESTful APIs using Spring Boot and optimizing PostgreSQL database schemas for high-traffic applications. Rohann has developed impactful projects, including a caffeine-tracking platform with React, a real-time age and gender detection system using OpenCV, and a Discord music bot deployed on Raspberry Pi. Proficient in Python, Java, React.js, and cloud technologies like AWS, he combines technical expertise with strong problem-solving and teamwork skills. A LeetCode enthusiast with over 150 DSA problems solved, a state-level Abacus medalist, and a competitive Rocket League player, Rohann brings a blend of analytical rigor and creative innovation to every challenge.
        </p>
      </section>
    );
  };

export default Hero;
